import React from 'react'


class Product extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      items: {},
      isLoaded: false,
    }
  }


  componentDidMount() {
    fetch('https://ipif01.herokuapp.com/api/Product/GetCategoryNearBy?latitude=28.7041&longitude=77.1025')
      .then(res => {return res.json();})
      .then(json => {
        this.setState({
          isLoaded: true,
          items: json,    })
      });
  }
  render() {

  const { isLoaded, items } = this.state;
    if (!isLoaded) {
      return <div>Loading...</div>
    }
    else {
      return (
        <div >
         <ul>
           {items.map( item => 
             <li key={item.id}>{item.status}</li>
           )}
         </ul>
      </div>
      )
    }
  }
}
export default Product;
